import React from "react";
import ListItem from "./ListItem";

function Houses({name}){

  const displayHouses = name.map((names, id) => {
    return <ListItem 
      key={id}
      id={id+1}
      s_name={names}
    />
    }
  )
  return(
    <div>
      <li>
       {displayHouses}
      </li>
    </div>
  )
}

export default Houses;
